INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 7, 0.0, "キャル", 7001, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 106001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 7, 0.0, "コッコロ", 7002, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 7, 0.0, "ペコリーヌ", 7003, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 10, 0.0, "ペコリーヌ", 10001, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 10, 0.0, "キャル", 10002, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 106001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 10, 0.0, "コッコロ", 10003, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 10, 0.0, "シェフィ", 10004, "2015/12/17 15:00:00", 1, 2, 1, -363.0, 106401, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 12, 0.0, "ペコリーヌ", 12001, "2015/12/17 15:00:00", 1, 1, 1, -416.5, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 13, 0.0, "キャル", 13001, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 106001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 13, 0.0, "コッコロ", 13002, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13, 0.0, "シェフィ", 13003, "2015/12/17 15:00:00", 1, 2, 1, -363.0, 106401, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 13, 0.0, "ペコリーヌ", 13004, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 14, 0.0, "コッコロ", 14001, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 14, 0.0, "シェフィ", 14002, "2015/12/17 15:00:00", 1, 2, 1, -363.0, 106401, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 14, 0.0, "ペコリーヌ", 14003, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 14, 0.0, "キャル", 14004, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 106001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 15, 0.0, "コッコロ", 15001, "2015/12/17 15:00:00", 1, 1, 1, -470.0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 16, 0.0, "シェフィ", 16001, "2015/12/17 15:00:00", 1, 2, 1, -363.0, 106401, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 16, 0.0, "ペコリーヌ", 16002, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 16, 0.0, "キャル", 16003, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 106001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 16, 0.0, "コッコロ", 16004, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 17, 0.0, "コッコロ", 17002, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 25, 0.0, "キャル", 17004, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 106001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 25, 0.0, "コッコロ", 17005, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 25, 0.0, "シェフィ", 17006, "2015/12/17 15:00:00", 1, 2, 1, -363.0, 106401, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 25, 0.0, "ペコリーヌ", 17007, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 18, 0.0, "カリン", 18001, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 18, 0.0, "カリン", 18002, "2015/12/17 15:00:00", 2, 1, 1, -363.0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 19, 0.0, "カリン", 19001, "2015/12/17 15:00:00", 3, 1, 1, -470.0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 19, 0.0, "カリン", 19002, "2015/12/17 15:00:00", 4, 1, 1, -470.0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 20, 0.0, "カリン", 20001, "2015/12/17 15:00:00", 5, 1, 1, -470.0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 20, 0.0, "カリン", 20002, "2015/12/17 15:00:00", 6, 1, 1, -470.0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 21, 0.0, "キャル", 21001, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 106001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 21, 0.0, "コッコロ", 21002, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 21, 0.0, "シェフィ", 21003, "2015/12/17 15:00:00", 1, 2, 1, -363.0, 106401, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 21, 0.0, "ペコリーヌ", 21004, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 22, 0.0, "カリン", 22001, "2015/12/17 15:00:00", 1, 1, 1, -430.0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 22, 0.0, "カリン", 22002, "2015/12/17 15:00:00", 2, 1, 1, -430.0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 23, 0.0, "カリン", 23001, "2015/12/17 15:00:00", 3, 1, 1, -430.0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 23, 0.0, "カリン", 23002, "2015/12/17 15:00:00", 4, 1, 1, -430.0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 8.0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24, 4.08, "エリコ（バレンタイン）", 24001, "2019/01/31 12:00:00", 1, 1, 2, -385.0, 109001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 8.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24, 5.0, "エリコ（バレンタイン）", 24002, "2019/01/31 12:00:00", 2, 1, 2, -385.0, 109001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 8.0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24, 10.11, "エリコ（バレンタイン）", 24003, "2019/01/31 12:00:00", 3, 1, 2, -385.0, 109001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 8.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24, 4.0, "エリコ（バレンタイン）", 24004, "2019/01/31 12:00:00", 4, 1, 2, -385.0, 109001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 8.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24, 6.0, "エリコ（バレンタイン）", 24005, "2019/01/31 12:00:00", 5, 1, 2, -385.0, 109001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24, 0.0, "エリコ（バレンタイン）", 24006, "2019/01/31 12:00:00", 6, 1, 1, 0.0, 109002, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24, 0.0, "エリコ（バレンタイン）", 24007, "2019/01/31 12:00:00", 7, 1, 1, 0.0, 109002, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24, 0.0, "エリコ（バレンタイン）", 24008, "2019/01/31 12:00:00", 8, 1, 1, 0.0, 109002, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24, 0.0, "エリコ（バレンタイン）", 24009, "2019/01/31 12:00:00", 9, 1, 1, 0.0, 109002, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24, 0.0, "エリコ（バレンタイン）", 24010, "2019/01/31 12:00:00", 10, 1, 1, 0.0, 109002, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 8.0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24, 2.12, "シズル（バレンタイン）", 24011, "2019/01/31 12:00:00", 1, 1, 2, -385.0, 109101, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 8.0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24, 4.19, "シズル（バレンタイン）", 24012, "2019/01/31 12:00:00", 2, 5, 2, -385.0, 109101, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 8.0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 24, 2.3, "シズル（バレンタイン）", 24013, "2019/01/31 12:00:00", 3, 2, 4, -385.0, 109101, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 24, 0.0, "シズル（バレンタイン）", 24014, "2019/01/31 12:00:00", 4, 1, 1, 0.0, 109102, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 8.0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 24, 5.23, "シズル（バレンタイン）", 24015, "2019/01/31 12:00:00", 5, 5, 2, -385.0, 109101, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 24, 0.0, "シズル（バレンタイン）", 24016, "2019/01/31 12:00:00", 6, 1, 1, 0.0, 109102, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 8.0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 24, 5.01, "シズル（バレンタイン）", 24017, "2019/01/31 12:00:00", 7, 1, 2, -385.0, 109101, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 24, 0.0, "シズル（バレンタイン）", 24018, "2019/01/31 12:00:00", 8, 1, 1, 0.0, 109102, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 24, 0.0, "シズル（バレンタイン）", 24019, "2019/01/31 12:00:00", 9, 1, 1, 0.0, 109102, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10011, 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 24, 0.0, "シズル（バレンタイン）", 24020, "2019/01/31 12:00:00", 10, 1, 1, 0.0, 109102, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 26, 0.0, "シェフィ", 26001, "2015/12/17 15:00:00", 1, 2, 1, -363.0, 106401, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 26, 0.0, "ペコリーヌ", 26002, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105801, 0, "2030/12/17 14:59:59");
