INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 42, 0.0, "ペコリーヌ", 42003, "2015/12/17 15:00:00", 1, 1, 1, -416.5, 105801, 0, "2030/12/17 14:59:59");
