INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 43, 0.0, "ペコリーヌ", 43001, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 43, 0.0, "コッコロ", 43002, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 43, 0.0, "キャル", 43003, "2015/12/17 15:00:00", 1, 1, 1, -363.0, 106001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 44, 0.0, "アメス", 43004, "2015/12/17 15:00:00", 1, 1, 1, -416.5, 123001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 44, 0.0, "アメス", 43005, "2015/12/17 15:00:00", 2, 1, 1, -416.5, 123001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 45, 5.79, "アメス", 43006, "2015/12/17 15:00:00", 3, 1, 2, -416.5, 123001, 0, "2030/12/17 14:59:59");
